import axios from "@/axios";

class eyeRestApi {
  async registrationEyeOrg(accountClass) {
    try {
      return await axios.post(
        "auth/organization/eye-registration",
        accountClass
      );
    } catch (error) {
      console.log(error);
    }
  }
}
export default new eyeRestApi();
